import React from 'react';
import Navbar from './components/Navbar/Navbar.jsx';
import AppRoutes from './router/Routers.js';
import Footer from './components/Footer/Footer.jsx';

function App() {
    return (
        <div className="App">
        <Navbar />
        <Sidebar />
        <div className="content">
          <AppRoutes />
        </div>
        <Footer />
      </div>
    );
}

export default App;
